import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <section className='main'>
      <section className="content-wrapper">
        <form action="/" className='form'>
          <section className="form-item">
          <p>kortelės numeris: </p>
          <input type="text" name='cardNumber' placeholder='Įveskite kortelės numerį' className='form-item' id='main-card-number'/>
          </section>
        </form>
      </section>
    </section>
  );
}

export default App;
